class Signup {  Token? token;  Account? account;  Signup({this.token, this.account});  Signup.fromJson(Map<String, dynamic> json) {    token = json['token'] != null ? new Token.fromJson(json['token']) : null;    account =    json['account'] != null ? new Account.fromJson(json['account']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.token != null) {      data['token'] = this.token!.toJson();    }    if (this.account != null) {      data['account'] = this.account!.toJson();    }    return data;  }}class Token {  String? access;  Token({this.access});  Token.fromJson(Map<String, dynamic> json) {    access = json['access'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['access'] = this.access;    return data;  }}class Account {  int? id;  String? firstName;  String? lastName;  String? email;  String? profilePic;  Account(      {this.id, this.firstName, this.lastName, this.email, this.profilePic});  Account.fromJson(Map<String, dynamic> json) {    id = json['id'];    firstName = json['first_name'];    lastName = json['last_name'];    email = json['email'];    profilePic = json['profile_pic'];  }   Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['first_name'] = this.firstName;    data['last_name'] = this.lastName;    data['email'] = this.email;    data['profile_pic'] = this.profilePic;    return data;  }}